import React from 'react';
import {Carousel} from 'react-bootstrap';
import live from '../../Assets/liveincanada.png';
import work from '../../Assets/workincanada.png';
import study from '../../Assets/studyincanada';
import move from '../../Assets/movetocanda.png';
import './Corousel.css';

export default class Corousel extends React.Component {

  render() {
    return (
      <div className="cor">
      <Carousel indicators={false} controls={false} interval={2000}>
      <Carousel.Item>

        <img
          className="d-block w-100 image-container"
          src={move}
          alt="First slide"
        />



      </Carousel.Item>
      <Carousel.Item>
        <img
          className="d-block w-100 image-container"
          src={banfflake}
          alt="Third slide"
        />

        <Carousel.Caption>
          <h1 className='corText'>Study in Canada</h1>
          <p className="corepa">Get high quality education</p>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <img
          className="d-block w-100 image-container"
          src={towerh}
          alt="Third slide"
        />

        <Carousel.Caption>
          <div className ="hehe">
          <h1 className='corText'>Work in Canada</h1>
          <p className="corepa">Shape your career in best working environmen .</p>
          </div>

        </Carousel.Caption>
      </Carousel.Item>

      <Carousel.Item>
        <img
          className="d-block w-100 image-container"
          src={manitoba}
          alt="Third slide"
        />

        <Carousel.Caption>
          <h1 className='corText'>Visit Canada</h1>
          <p className="corepa">Unpack an incredible experience</p>
        </Carousel.Caption>
      </Carousel.Item>
    </Carousel>
    </div>
    );
  }
}
